import axios from "axios";
import React, { Component } from "react";
import ReportService from "../services/ReportService";

class CreateReportComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      reportId: this.props.match.params.reportId,
      reportName: "",
      reportType: "",
      adminId: "",
    };
    this.changeReportNameHandler = this.changeReportNameHandler.bind(this);
    this.changeReportTypeHandler = this.changeReportTypeHandler.bind(this);
    this.changeAdminIdHandler = this.changeAdminIdHandler.bind(this);
    this.saveOrUpdateReport = this.saveOrUpdateReport.bind(this);
  }

  componentDidMount() {
    if (this.state.reportId === "_add") {
      axios.post("report/add/1", {
        reportName: this.state.reportName,
        reportType: this.state.reportType,
        adminId: this.state.adminId,
      });
    } else {
      ReportService.getReportById(this.state.reportId).then((res) => {
        let report = res.data;
        this.setState({
          reportName: report.reportName,
          reportType: report.reportType,
          adminId: report.adminId,
        });
      });
    }
  }
  saveOrUpdateReport = (e) => {
    e.preventDefault();
    let report = {
      reportName: this.state.reportName,
      reportType: this.state.reportType,
      adminId: this.state.adminId,
    };
    console.log("report => " + JSON.stringify(report));

    ReportService.createReport(report).then((res) => {
        this.props.history.push("/report/_add");
    });
  };

  changeReportNameHandler = (event) => {
    this.setState({ reportName: event.target.value });
  };

  changeReportTypeHandler = (event) => {
    this.setState({ reportType: event.target.value });
  };

  changeAdminIdHandler = (event) => {
    this.setState({ adminId: event.target.value });
  };

 

  cancel() {
    this.props.history.push("/report");
  }

  getTitle() {
    if (this.state.reportId === "_add") {
      return <h3 className="text-center">Add Report</h3>;
    } else {
      return <h3 className="text-center">Update Report</h3>;
    }
  }
  render() {
    return (
      <div>
        <br></br>
        <div className="container">
          <div className="row">
            <div className="card col-md-6 offset-md-3 offset-md-3">
              {this.getTitle()}
              <div className="card-body">
                <form>
                  <div className="form-group">
                    <label> Report Name: </label>
                    <input
                      placeholder="Report Name"
                      name="reportName"
                      className="form-control"
                      value={this.state.reportName}
                      onChange={this.changeReportNameHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> Agent Name: </label>
                    <input
                      placeholder="Agent Name"
                      name="reportType"
                      className="form-control"
                      value={this.state.reportType}
                      onChange={this.changeReportTypeHandler}
                    />
                  </div>
                  <div className="form-group">
                    <label> AdminId: </label>
                    <input
                      placeholder="AdminId"
                      name="adminId"
                      className="form-control"
                      value={this.state.adminId}
                      onChange={this.changeAdminIdHandler}
                    />
                  </div>

                  <button
                    className="btn btn-success"
                    onClick={this.saveOrUpdateReport}
                  >
                    Save
                  </button>
                  <button
                    className="btn btn-danger"
                    onClick={this.cancel.bind(this)}
                    style={{ marginLeft: "10px" }}
                  >
                    Cancel
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default CreateReportComponent;
